import React from "react";
import "./Content.css";
const Content = ({data}) => {
  return (
    <div className="content-container">
      {data.map((item) => {
        return(
            <div className="items-container">
            <span class="picture-container">
              <img src={item.src} />
            </span>
            <div className="course-info">
              <p>{item.name}</p>
              <div>
                <span>{item.hours} - </span>
                <span>{item.day}</span>
              </div>
            </div>
            <button>Reserve</button>
          </div>
        )
     
      })}
    </div>
  );
};

export default Content;
